def predict(triples: list[Triple]) -> str:
    subject_to_sentences = {}
    for triple in triples:
        subject = triple.subject
        if subject not in subject_to_sentences:
            subject_to_sentences[subject] = []

        if triple.predicate == "country":
            subject_to_sentences[subject].append(f"{subject} is in {triple.object}.")
        elif triple.predicate == "foundingDate":
            subject_to_sentences[subject].append(f"{subject} was founded on {triple.object}.")
        elif triple.predicate == "industry":
            subject_to_sentences[subject].append(f"{subject} operates in the {triple.object}.")
        elif triple.predicate == "city":
            subject_to_sentences[subject].append(f"{subject} is located in {triple.object}.")
        elif triple.predicate == "netIncome":
            subject_to_sentences[subject].append(f"The net income of {subject} is {triple.object}.")
        elif triple.predicate == "operatingIncome":
            subject_to_sentences[subject].append(f"The operating income of {subject} is {triple.object}.")
        # Add other predicates here similarly
        else:
            subject_to_sentences[subject].append(f"{subject} {triple.predicate} {triple.object}.")

    sentences = []
    for subject, sentence_list in subject_to_sentences.items():
        if len(sentence_list) > 1:
            combined_sentence = sentence_list[0]
            for i in range(1, len(sentence_list)):
                combined_sentence += ", " + sentence_list[i]
            sentences.append(combined_sentence)
        else:
            sentences.append(sentence_list[0])

    return " ".join(sentences)

